import React from 'react'

const CountryButton = () => {

    var modalButton = {
        backgroundImage : <a href="https://www.pngkey.com/detail/u2w7e6u2a9q8e6i1_guatemala-flag-black-and-white/" target="_blank">Guatemala Flag Black And White @pngkey.com</a>
    }

    return (
       <button className = "btn" style={modalButton}> Test</button>
    )
}

export default CountryButton
